import{_ as l,c as i,o as e,a1 as a}from"./chunks/framework.CdPWczmu.js";const C=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"Notes/PCB/PCB工具箱.md","filePath":"Notes/PCB/PCB工具箱.md","lastUpdated":1722565193000}'),t={name:"Notes/PCB/PCB工具箱.md"},o=a('<h3 id="测试数据" tabindex="-1">测试数据 <a class="header-anchor" href="#测试数据" aria-label="Permalink to &quot;测试数据&quot;">​</a></h3><ol><li>导出数据时应该打开<strong>top</strong>和<strong>bottom</strong>层</li><li>导出数据时，应该<strong>打开机械孔</strong>，避免计算路径时忽略机械孔的范围 <ul><li>打开方式：color/Areas/Route/All</li></ul></li><li>TC Escape <ul><li>up.txt和down.txt勾选器件：pins、vias、shapes、clines</li><li><strong>避坑</strong>：config文件中reference不能有重复的数据</li><li>工具箱中使用默认数据即可</li></ul></li><li>BGA Escape <ul><li>vias框选范围：DUT部分的vias</li><li>layer文件：layer名称和项目中的layer名称保持一致</li></ul></li><li>Net Connect <ul><li>pins：需要及时更新，避免出现文件内信息不匹配的情况导致DRC</li></ul></li></ol><h3 id="测试结果" tabindex="-1">测试结果 <a class="header-anchor" href="#测试结果" aria-label="Permalink to &quot;测试结果&quot;">​</a></h3><ul><li>BGA Escape <ol><li>检验走线数量：vias总数量-GND-power类型=DUT部分应走线的数量 <ul><li>项目22156：1089-287-198=604</li></ul></li><li>检查同层走线是否有重叠，断开，交叉的情况</li><li>检查pitch、线宽是否满足计算时设定的限制</li><li>检查应该走线的vias是否都完成走线，不应走线的是否有走线情况</li><li>分层检查是否有重复走线</li><li>检查是否会避开已经走线的vias（需求待添加，暂不关注）</li><li>检查走线是否出现跨区域的情况</li></ol></li><li>TC Escape <ol><li>检查总数量是否符合数据设定，并分层检查每次的数量 <ul><li>项目A22156：单层上下和108，上下各54。7层总和756.</li></ul></li><li>检查同层走线是否有重叠，交叉，断开的情况</li><li>检查走线是否规避机械孔</li><li>检查线宽、线线距是否满足计算时设定的限制</li><li>检查走线是否有避开pins</li></ol></li><li>Net Connect <ol><li>检查走线是否避开机械孔</li><li>检查同层走线是否有重叠、断开、交叉的情况</li><li>检查TC走线是否被链接</li></ol></li><li>Free Connect <ol><li>检查DUT中非TC的走线是否被连接</li><li>检查同层走线是否有重叠，断开，交叉的情况</li><li>检查走线是否避开机械孔</li></ol></li></ul><h3 id="问题判定" tabindex="-1">问题判定 <a class="header-anchor" href="#问题判定" aria-label="Permalink to &quot;问题判定&quot;">​</a></h3><ul><li><p>数据排查：相同项目不同状态的板子导出数据</p><ul><li>检查框选范围是否正确</li><li>对比不同状态下的数据，检查是否出现脏数据</li><li>检查计算结果，并导入PCB板子中，检查导入结果是否相同</li></ul></li><li><p>PCB板子排查：</p><ul><li>使用之前的计算结果导入板子中检查结果</li><li>框选不同范围并检查框选数据</li></ul></li><li><p>算法问题：排除上述问题后，在讨论算法的问题，注意在排除上述问题的时候需要关注测试数据中的关键点</p></li><li><p>A22156项目作为冒烟测试用例</p></li><li><p>添加新得测试用例：BGA Escape环形出线查看层数是否超出预期：最少层 ≤ 环形出线 ≤ 逐行逐列</p></li></ul>',6),s=[o];function r(n,c,p,u,_,d){return e(),i("div",null,s)}const P=l(t,[["render",r]]);export{C as __pageData,P as default};
